import {useEffect} from "react";
import api from "../services/api";
const https = require('https')


export default function Home(){
    useEffect(() => {
        https.get('https://localhost:3333/', (resp) =>{
            let data = '';

            resp.on('data', (chunk) =>{
                data += chunk;
            });

            resp.on('error', (err) =>{
                console.log(JSON.parse(data).explanation);
            });
        });
    }, []);
    return (
    <div>
        Home
    </div>
    )
}
